import { useState } from "react";
import { SearchFiltersBox } from "../style";

export const Filters = () => {
  let list = [
    "Name A-Z",
    "Name Z-A', Price from low to high",
    "Price from high to low",
    "Amount from low do high",
    "Amount from high to low",
  ];

  const [showList, setShowList] = useState<boolean>(false);
  return (
    <SearchFiltersBox>
      <input type={"button"}></input>
      {!showList ? null : list.map((x) => <input type={"button"}>{x}</input>)}
    </SearchFiltersBox>
  );
};
